def count_substrings_with_k_ones(k: int, s: str) -> int:
    n = len(s)
    dp = [-1]
    for i in range(n):
        if s[i] == '1':
            dp.append(i)
    dp.append(n)
    if len(dp) - 2 <= k:
        return 0
    if k == 0:
        ans = 0
        for i in range(1, len(dp)):
            ans += (dp[i] - dp[i - 1] - 1) * (dp[i] - dp[i - 1]) // 2
        return ans
    ans = 0
    for i in range(k, len(dp) - 1):
        ans += (dp[i + 1] - dp[i]) * (dp[i - k + 1] - dp[i - k])
    return ans

